import React, { Component }  from 'react';

export class Form extends Component {

  render() {
    return (
      <div>
        <button type="button" onClick={this.props.clearList}>
          Clear
        </button>
        <form>
          <p>Enter new brand</p>
          <input type="text" placeholder="brand" onChange={this.props.changeBrand} />
          <button type="button" onClick={this.props.addItem}>
            Add Item
          </button>
        </form>
      </div>
    )
  }
}
